import{_ as a}from"./_plugin-vue_export-helper.cdc0426e.js";import{o as e,c as i,d as r}from"./app.36728030.js";const p={},d=r('<h1 id="关闭微信朋友圈广告和公众号推荐流" tabindex="-1"><a class="header-anchor" href="#关闭微信朋友圈广告和公众号推荐流" aria-hidden="true">#</a> <strong>关闭微信朋友圈广告和公众号推荐流</strong></h1><p>在开始先说明一下，要使用下面介绍的调式功能，大家的手机需要有root权限，如没有的话，大家就看看就好，看看是如何操作和玩法的。</p><h2 id="_1、" tabindex="-1"><a class="header-anchor" href="#_1、" aria-hidden="true">#</a> 1、</h2><p>准备工作：你的手机需root、下载安装创建快捷方式APP（酷安搜索就有）</p><h2 id="_2、" tabindex="-1"><a class="header-anchor" href="#_2、" aria-hidden="true">#</a> 2、</h2><p>打开创建快捷方式APP之后，大家点击搜索框，直接搜微信，即可进入活动界面。</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_85b74667_6273_6993_713@1424x1064.jpeg.m.jpg" alt="img" loading="lazy"></p><p>微信快捷方式-搜索微信</p><h2 id="_3、" tabindex="-1"><a class="header-anchor" href="#_3、" aria-hidden="true">#</a> 3、</h2><p>在活动界面直接搜“com.tencent.mm.plugin.brandservice.ui.timeline.BizTestUI”活动（记得点击右上角✔也显示未导出的活动）</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_9a6033c4_6273_7001_734@1440x703.jpeg.m.jpg" alt="img" loading="lazy"></p><p>com.tencent.mm.plugin.brandservice.ui.timeline.BizTestUI</p><h2 id="_4、" tabindex="-1"><a class="header-anchor" href="#_4、" aria-hidden="true">#</a> 4、</h2><p>点击详情进入可以看到一个打开的入口。</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_74c93fe2_6273_7007_223@1440x1298.jpeg.m.jpg" alt="img" loading="lazy"></p><p>详情</p><h2 id="_5、" tabindex="-1"><a class="header-anchor" href="#_5、" aria-hidden="true">#</a> 5、</h2><p>获取root权限后，我们点击打开即可跳转到微信的一个调试界面。</p><p>调试窗口</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_ae4be29f_6273_7009_570@1440x1092.jpeg.m.jpg" alt="img" loading="lazy"></p><h3 id="广告-推荐" tabindex="-1"><a class="header-anchor" href="#广告-推荐" aria-hidden="true">#</a> 广告-推荐</h3><p>在这个页面，大家应该也可以看到很多的功能，选择广告入口和推荐入口。</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_eff07a76_6273_7017_434@1440x1092.jpeg.m.jpg" alt="img" loading="lazy"></p><h3 id="广告入口-关闭广告" tabindex="-1"><a class="header-anchor" href="#广告入口-关闭广告" aria-hidden="true">#</a> 广告入口-关闭广告</h3><p>点击进来大家就可看到关于广告的一些功能。选择广告入口-关闭广告。</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_cd6bdaf5_6273_7021_785@1440x2970.jpeg.m.jpg" alt="img" loading="lazy"></p><h3 id="推荐入口-关闭推荐流" tabindex="-1"><a class="header-anchor" href="#推荐入口-关闭推荐流" aria-hidden="true">#</a> 推荐入口-关闭推荐流</h3><p>选择推荐入口-关闭推荐流。</p><p><img src="http://image.coolapk.com/feed/2021/1202/14/2516961_34f99214_6273_7023_485@1440x2980.jpeg.m.jpg" alt="img" loading="lazy"></p><h3 id="" tabindex="-1"><a class="header-anchor" href="#" aria-hidden="true">#</a></h3><p>点击之后微信将会重启跳一下，亲测朋友圈广告和公众号推荐流广告都消失了！</p>',31),t=[d];function h(c,o){return e(),i("div",null,t)}const l=a(p,[["render",h],["__file","关闭微信广告.html.vue"]]);export{l as default};
